export default function CreateProduct(){
    const [name, setName] = useState('');

    return(
        <form>
            <label htmlFor='name'>
                <input type='text' name='name' id='name' placeholder='Name' value={name} onChange={e => setName(e.target.value)}/> 
            </label>
        </form>
    )
}
